import React, { useState } from "react";
import InputApp from "./InputApp";
import FrontPreview from "./FrontPreview";
import BackPreview from "./BackPreview";
import CardLayout from "./CardLayout";

export default function ContainerApp() {
	const [number, setNumber] = useState(1234123412341234);
	const [date1, setDate1] = useState(34);
	const [date2, setDate2] = useState(12);

	return (
		<>
			<div className="container">
				{/* child 2 */}
				<InputApp numberCallback={setNumber} dateCallback1={setDate1} dateCallback2= {setDate2}/>
				{/* child 1 */}
				<CardLayout number={number} date1={date1} />
				<BackPreview />
			</div>
		</>
	);
}
